CREATE TABLE  `statels` (
  `Playfield` int(11) NOT NULL,
  `Type` int(11) NOT NULL,
  `Instance` int(10) unsigned NOT NULL,
  `Template` int(11) NOT NULL,
  `id` int(10) NOT NULL,
  `x` float NOT NULL,
  `y` float NOT NULL,
  `z` float NOT NULL,
  PRIMARY KEY (`id`,`Type`,`Instance`,`Playfield`) USING BTREE
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

